create table tbl_Patients
(
    ID           int auto_increment
        primary key,
    Sirname      varchar(50)  not null,
    Name         varchar(50)  not null,
    SecondName   varchar(50)  null,
    Sex          tinyint      not null,
    Birthday     date         not null,
    Priviledge   int          not null,
    Employment   tinyint      not null,
    Workplace    varchar(200) null,
    Passport     int          not null,
    Snils        varchar(11)  null,
    Police       int          not null,
    FamilyStatus tinyint      not null,
    Telephone    varchar(13)  null,
    constraint tbl_Patients_spr_Employment_ID_fk
        foreign key (Employment) references spr_Employment (ID),
    constraint tbl_Patients_spr_FamilyStatus_ID_fk
        foreign key (FamilyStatus) references spr_FamilyStatus (ID),
    constraint tbl_Patients_spr_Priviledge_ID_fk
        foreign key (Priviledge) references spr_Priviledge (ID),
    constraint tbl_Patients_spr_Sex_ID_fk
        foreign key (Sex) references spr_Sex (ID),
    constraint tbl_Patients_tbl_Passports_ID_fk
        foreign key (Passport) references tbl_Passports (ID),
    constraint tbl_Patients_tbl_Polices_ID_fk
        foreign key (Police) references tbl_Polices (ID)
);

